export default function StickyCTA() {
    return (
        <div className="fixed bottom-0 left-0 right-0 md:hidden bg-white/95 backdrop-blur-lg shadow-2xl p-4 border-t border-gray-200 z-40">
            <div className="flex items-center justify-between">
                <div>
                    <p className="font-semibold text-gray-900 text-sm">Ready to start?</p>
                    <p className="text-xs text-gray-600">Get pre-approved in minutes</p>
                </div>
                <a
                    href="/pre-approval"
                    className="px-6 py-3 text-white font-semibold rounded-lg shadow-lg"
                    style={{ backgroundColor: 'var(--primary)' }}
                >
                    Get Started
                </a>
            </div>
        </div>
    );
}
